import React, {useState} from 'react';
import './table.css';

export default class Backend extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            error: null,
            isLoaded: false,
            subscribers: []
        };
    }

    componentDidMount() {
        fetch("https://api.sheety.co/a4c738ad49ee1d97b368830238289575/subscribers/subscribers",{
            headers: {"Content-type": "application/json; charset=UTF-8"}
        })
            .then(res => res.json())
            .then(
                (result) => {
                    this.setState({
                        isLoaded: true,
                        items: result.subscribers,
                    });
                },
                // Note: it's important to handle errors here
                // instead of a catch() block so that we don't swallow
                // exceptions from actual bugs in components.
                (error) => {
                    this.setState({
                        isLoaded: true,
                        error
                    });
                }
            )
    }

    renderTableData(){
        return this.state.subscribers.map((subscriber, index) => {
            const {id, fullName, gender, emailAddress, state} = subscriber
            return (
                <tr key={id}>
                    <td>{id}</td>
                    <td>{fullName}</td>
                    <td>{gender}</td>
                    <td>{emailAddress}</td>
                    <td>{state}</td>
                </tr>
            )
        })
    }

    render() {
        const { error, isLoaded, subscribers } = this.state;
        if (error) {
            return <div>Error: {error.message}</div>;
        } else if (!isLoaded) {
            return <div>Loading...</div>;
        } else {
            return (
                <div>
                    <h1 id='title'>Subscribers</h1>
                    <table id='subscribers'>
                        <tbody>
                        {this.renderTableData()}
                        </tbody>
                    </table>
                </div>
            );
        }
    }
}
